import java.util.HashSet;

public class MyHashSet {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		HashSet<String> myHashSet = new HashSet();
		myHashSet.add("One");
		myHashSet.add("Two");
		myHashSet.add("Three");
		myHashSet.add("Four");
		myHashSet.add("Five");
		
		System.out.println(myHashSet);

	}

}
